import React from "react";

const Footer = () => {
  return (
    <footer style={styles.footer}>
      <p>This is my footer</p>
    </footer>
  );
};

export default Footer;

const styles = {
  footer: {
    backgroundColor: "#ff0000",
    display: "flex",
    flexDirection: "row",
    fontSize: "0.65rem",
    padding: "1%",
    justifyContent: "center",
  },
};
